¿Qué es una alimentación baja en grasas, conformada por alimentos naturales sin procesar y basada en plantas?
Es un tipo de dieta que incluye muchos alimentos de origen vegetal
sin procesar, como por ejemplo, verduras, fruta, frijoles, lentejas,
nueces, semillas, granos enteros y pequeñas cantidades de grasas saludables. No incluye productos de origen animal, tales como
carne, pollo, pescado, productos lácteos ni huevo. Tampoco incluye alimentos procesados (envasados en frasco, lata, caja, bolsa) ni golosinas.
¿Cuáles son los beneficios para la salud de una alimentación de origen vegetal?
•Disminuyeelcolesterol,lapresiónaltayelniveldeazúcarenlasangre 
• Puede revertir o prevenir las enfermedades del corazón
• Vida más larga
• Peso más saludable
• Menos riesgo de cáncer y diabetes
• Puede retrasar el progreso de ciertos tipos de cáncer
• Mejoría en los síntomas de la artritis reumatoide
• Menos inflamación del cuerpo
• Es posible tomar menos medicamentos
• Gastar menos en la compra de alimentos
• Favorece el medioambiente (las plantas consumen menos energía)🍑🍅🥒🥝🥝🥭🍍🍆🌶🥬🥝🍑🥑🍉🍌🍇🍈🥦🥦🥕🌽🌶🧅🧅🌽🌽🥕🥕🥐🥔🧅🥯🥖🍉🧀🍆🍍🍍🍅🍅🍅🍍

